import React from "react";
import "./AboutMe.css";

export default function AboutMe() {
  return (
    <div className="aboutme-container">
      <h1>
        About<span className="aboutme-white">Me</span>
      </h1>
      <h5>Get to know me</h5>
      <p>
        Hi, I'M Rifat. I'M a software developer.Software developers conceive of,
        design, and build computer programs. Some develop new applications for
        mobile or desktop use, while others build underlying operating systems.
        Either way, software developers identify user needs, build programs,
        test out new software, and make improvements.
      </p>
    </div>
  );
}
